import React from 'react';
import NewsCard from '../NewsCard/NewsCard';

function NewsCardList(props) {
    const c = props.cards
    console.log(c)

    return (
        <section className='news-list'>

            {props.page === 'main' && <h3 className='news-list__title'>Search results</h3>}

            <ul className='news-list__cards'>
                {
                    c.map((c) => {
                        return <NewsCard
                            title={c.title}
                            link={c.url}
                            image={c.urlToImage}
                            source={c.source}
                            date={c.publishedAt}
                            text={c.content}
                        />
                    })
                }
            </ul>

            {props.page === 'main' && <button className='button news-list__show-more' type='button'>Show more</button>}
        </section>
    )
    // 
    //                 link={props.cards.articles.url}
    //                 image={props.cards.articles.urlToImage}
    //                 source={props.cards.articles.source}
    //                 date={props.cards.articles.publishedAt}
    //                 text={props.cards.articles.content}
}

export default NewsCardList;
